@DougDeMuro; Yes, Tesla model Y has good space and is practical because it is a  hatchback. The  big   problem is the low payload, which you did not mention in the video.


The available payload in Tesla Y is only 402 kg. For comparison 29:12 Toyota Highlander Hybrid allows 696 kg payload. The average weight of an  adult in US is 80.5 kg. Tesla Y is a car 4 adults with some luggage, or 5 adults if they drive naked and do not bring any luggage.


Tesla claims "Room for up to seven adults with optional third row" that is be 563 kg, a 40% overload and illegal to drive. Tesla please stop this marketing nonsense, it is a car for 4 adults.
